import React, { Component } from 'react';
import Motivate from './motivate';
import { Grid, Cell } from 'react-mdl';

class Addquote extends Component {


    render() {
        return(
            <div>
                <Grid>
                    <Cell col={6}>
                    <Motivate/>
                    </Cell>
                         
                    <Cell col={6}> 
                    <div> 
                    <br></br>
                        <h3 className="DevName" align="center">Add New Goals</h3>
                            <hr></hr>
                        <h5 align="center">No Goals to Display</h5>
                    </div> 
                    </Cell>

                </Grid>
            </div>
        
        )
    }
}

export default Addquote;
